#include "sorting.h"
#include "timing.h"
#include <stdio.h>
#include <stdlib.h>

void print(int array[], int size) 
{
    for(int i=0; i<size; ++i)
    {
        printf("%d ", array[i]);
    }
    printf("\n");
}

inline void bubbleSortPrivate(int array[], int size)
{
    bool sorted = false;

    while(!sorted)
    {
        sorted = true;
        int temp = -999;

        for(int i=0; i<size-1; ++i)
        {
            if(array[i] > array[i+1])
            {
                sorted = false;
                temp = array[i];
                array[i] = array[i+1];
                array[i+1] = temp;
                //print(array, size); //print each swap, for testing
            }
        }
    }
}

void bubbleSort(int array[], int size)
{
    if(size <= 0) return;

    printf("Bubble Sort: ");

    bubbleSortPrivate(array, size);

    print(array, size);
}

